Rescisão indireta

Uma maneira mais simples de defini-la é dizer que essa é uma forma de rescisão do contrato de trabalho por iniciativa do empregado, com justa causa do empregador.
Nesse caso, um funcionário pode pedir demissão sem precisar abrir mão de suas verbas indenizatórias, quando a empresa para a qual ele trabalha tem um comportamento que justifique seu desejo de sair.
A rescisão indireta se parece um pouco com o pedido de demissão, porque quem toma a iniciativa é o empregado; e também se parece um pouco com a despedida sem justa causa, porque o empregador deverá pagar as verbas indenizatórias.
Isso não é uma teoria de quem estuda o Direito e nem algo que os juízes criaram nos tribunais. A rescisão indireta está, de fato, prevista na própria legislação trabalhista.
Podemos vê-la no artigo 483 da CLT, onde também estão enumeradas as hipóteses em que a “justa causa do empregador” é cabível:
Art. 483 – O empregado poderá considerar rescindido o contrato e pleitear a devida indenização quando:
a) forem exigidos serviços superiores às suas forças, defesos por lei, contrários aos bons costumes, ou alheios ao contrato;
b) for tratado pelo empregador ou por seus superiores hierárquicos com rigor excessivo;
c) correr perigo manifesto de mal considerável;
d) não cumprir o empregador as obrigações do contrato;
e) praticar o empregador ou seus prepostos, contra ele ou pessoas de sua família, ato lesivo da honra e boa fama;
f) o empregador ou seus prepostos ofenderem-no fisicamente, salvo em caso de legítima defesa, própria ou de outrem;
g) o empregador reduzir o seu trabalho, sendo este por peça ou tarefa, de forma a afetar sensivelmente a importância dos salários.

